  /**
   * The transaction passed the precheck validations.
   */
  Status.Ok = new Status(0);

  /**
   * For any error not handled by specific error codes listed below.
   */
  Status.InvalidTransaction = new Status(1);

  /**
   * Payer account does not exist.
   */
