                  tokenId: key._toProtobuf(),
                  balance: value,
                  decimals:
                      // eslint-disable-next-line deprecation/deprecation
                      this.tokenDecimals != null
                          ? // eslint-disable-next-line deprecation/deprecation
                            this.tokenDecimals.get(key)
                          : null,
